#define GAMBATTE_GBC_COLOR_CORRECTION_LABEL_FR "Correction colorimétrique"
#define GAMBATTE_GBC_COLOR_CORRECTION_INFO_0_FR "Ajuste les couleurs de sortie pour correspondre à l'affichage du matériel réel de la Game Boy Color. 'GBC uniquement' garantit que la correction n'est appliquée que lorsque vous jouez à des jeux Game Boy Color, ou lorsque vous utilisez une palette de Game Boy Color pour coloriser un jeu Game Boy. 'Toujours' applique la correction colorimétrique sur tous les contenus, et produira des résultats inattendus/sous-optimaux lors de l'utilisation des palettes de couleurs internes 'GB' ou 'SGB'."
#define OPTION_VAL_GBC_ONLY_FR "GBC uniquement"
#define OPTION_VAL_ALWAYS_FR "Toujours"
#define GAMBATTE_GBC_COLOR_CORRECTION_MODE_LABEL_FR "Mode de correction colorimétrique"
#define GAMBATTE_GBC_COLOR_CORRECTION_MODE_INFO_0_FR "Spécifie la méthode utilisée lors de la correction colorimétrique. 'Précis' produit une sortie presque indifférenciable d'un vrai panneau LCD de Game Boy Color. 'Rapide' ne fait qu'obscurcir les couleurs et réduit la saturation, et peut être utilisé sur du matériel bas de gamme si la méthode 'Précis' est trop lente."
#define OPTION_VAL_ACCURATE_FR "Précis"
#define OPTION_VAL_FAST_FR "Rapide"
#define GAMBATTE_GBC_FRONTLIGHT_POSITION_LABEL_FR "Correction colorimétrique - Position de l'éclairage avant"
#define GAMBATTE_GBC_FRONTLIGHT_POSITION_INFO_0_FR "Simule la réponse physique du panneau LCD de la Game Boy Color lorsqu'il est illuminé sous différents angles. 'Centrale' représente la reproduction standard des couleurs. 'Au-dessus de l'écran' augmente la luminosité. 'En dessous de l'écran' réduit la luminosité. Ce paramètre s'applique uniquement lorsque le 'Mode de correction colorimétrique' est réglé sur 'Précis'."
#define OPTION_VAL_CENTRAL_FR "Centrale"
#define OPTION_VAL_ABOVE_SCREEN_FR "Au-dessus de l'écran"
#define OPTION_VAL_BELOW_SCREEN_FR "En dessous de l'écran"
